const Emitter = require('events')

const aboutConfig = require('./config').section
const emtrID = new Emitter();
emtrID.on(aboutConfig.section, function () {
   return 'about'
})


const bckgrdConfig = require('./config').background;
const emtrLightBg = new Emitter();
emtrLightBg.on(bckgrdConfig.lightBg, function () {
  return ''
})

function defaultObj(
  id,
  lightBg,
  lightText,
  lightTextDesc,
  topLine,
  headline,
  description,
  buttonLabel,
  imgStart,
  img,
  alt,
  dark,
  primary,
  darkText,
) {
  return {
    id: " ",
    lightBg: undefined,
    lightText: undefined,
    lightTextDesc: undefined,
    topLine: " ",
    headline: " ",
    description: " ",
    buttonLabel: " ",
    imgStart: false,
    img: " ",
    alt: "banking information",
    dark: undefined,
    primary: undefined,
    darkText: undefined,
  };
}



export const homeObjOne = defaultObj(
  'about', 
)

